import React from "react";

import Todo from "./models/todo";
import Todos from "./components/Todos";

function App() {
  const todos = [new Todo("1"), new Todo("2")];

  return (
    <div>
      <Todos items={["1", "2", "3"]} />
    </div>
  );
}

export default App;
